import React from "react";
import Tilt from 'react-tilt';
import './MyPhoto.css';

const MyPhoto = ({logo, width, onclick, text}) => {
	const photostyle = {width}
	return(
		<div className="MyPhoto" onClick={onclick}>
		<Tilt className="Tilt MyPhoto-tilt" style={photostyle}  options={{ max : 55 }} >
			<div className="Tilt-inner">
				<img src={logo} className="MyPhoto-tilt__img" alt="hemant garg"/> 
				<span>{text}</span>
			</div>
		</Tilt>
		</div>
	)
};

export default MyPhoto;
